<div class="entities" style="line-height: 2.5; direction: ltr">Effect of pioglitazone treatment on endoplasmic reticulum stress response in human adipose and in palmitate-induced stress in human liver and adipose cell lines . Obesity and elevated cytokine secretion result in a chronic inflammatory state and may cause the insulin resistance observed in type 2 diabetes . Recent studies suggest a key role for endoplasmic reticulum stress in hepatocytes and adipocytes from obese mice , resulting in reduced insulin sensitivity . To address the hypothesis that thiazolidinediones , which improve peripheral insulin sensitivity , act in part by reducing the endoplasmic reticulum stress response , we tested subcutaneous adipose tissue from 20 obese volunteers treated with pioglitazone for 10 wk . We also experimentally induced endoplasmic reticulum stress using palmitate , tunicamycin , and thapsigargin in the human HepG 2 liver cell line with or without pioglitazone pretreatment . We quantified endoplasmic reticulum stress response by measuring both gene expression and phosphorylation . Pioglitazone significantly improved insulin sensitivity in human volunteers ( P = 0.002 ) but did not alter markers of endoplasmic reticulum stress . Differences in pre - and posttreatment endoplasmic reticulum stress levels were not correlated with changes in insulin sensitivity or body mass index . In vitro , palmitate , thapsigargin , and tunicamycin but not oleate induced endoplasmic reticulum stress in HepG 2 cells , including increased transcripts

 and mitiglinide , but not sulfonylureas , induce insulin secretion through a mechanism mediated by calcium release from endoplasmic reticulum .

 and mitiglinide ( glinides ) are characterized as rapid-onset and short-acting insulinotropic agents . Although both compounds do not have a sulfonylurea structure , it has been postulated that insulin secretion is preceded by their binding to Kir 6.2 /

 complex , and a mechanism of insulin secretion of glinides has been accounted for by this pathway . However , we hypothesized the involvement of additional mechanisms of insulin secretion enhanced by glinides , and we analyzed the pattern of time course of insulin secretion from MIN 6 cells with the existence of agents that have specific pharmacologic actions . Dose-dependent effects of tolbutamide , glibenclamide , nateglinide , and mitiglinide were observed .

 secretion induced by 3 microM tolbutamide and 1 nM glibenclamide was completely inhibited by 10 microM diazoxide and 3 microM verapamil , although the latter half-component of insulin secretion profile induced by 3 microM nateglinide or 30 nM mitiglinide remained with the existence of those agents . Glinides enhanced insulin secretion even in Ca2 + - depleted medium , and its pattern of secretion was same as the pattern with existence of verapamil . The latter half was suppressed by 1 microM dantrolene , and concomitant addition of verapamil and dantrolene completely suppressed the entire pattern of insulin secretion enhanced by nateglinide . Thus , we conclude that glinide action is demonstrated through two pathways , dependently and independently , from the pathway through K ( DB00171 ) channels . We also demonstrated that the latter pathway involves the intracellular calcium release from endoplasmic reticulum via ryanodine receptor activation .</div>

 and p47phox , production of superoxide anion , the expression of monocyte chemoattractant protein - 1 , and intercellular adhesion molecule - 1 expression were observed . These results suggest that concomitant AT1 receptor and cholesterol biosynthesis blockade , particularly when given concomitantly , blunts oxidative stress and inflammation independent of blood pressure or cholesterol-related effects .</div>
